import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import { NavLink,Link } from 'react-router-dom';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faShopify } from '@fortawesome/free-brands-svg-icons';

function HeaderNav() {
  return (
    <Navbar expand="lg" className="bg-primary">
      <Container>
        <Navbar.Brand>Products App</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="ms-auto">
            <NavLink exact activeClassName='text-danger' className='nav-link my-auto' to='/'>Home</NavLink>
            <Link className='nav-link my-auto' to="/register">Register</Link>
            <Link className='nav-link my-auto' to="/login">Login</Link>
            <Link className='nav-link fs-2 my-auto' to="/cart">
              <FontAwesomeIcon icon={faShopify} />
            </Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default HeaderNav;
